import React, { useState } from 'react';

const LikeButton = () => {
    const [isLiked, setIsLiked] = useState(false);
    console.log(isLiked);
    return (
        <div>
            <button value={isLiked} onClick={() => setIsLiked(!isLiked)}>This is like LikeButton!</button>
            <p>You have { isLiked ? 'Liked' : 'Unliked'} the button</p>
        </div>
    )
};

export default LikeButton;
